import { Link } from "react-router-dom";

import './IndexMenu.css'

export default function IndexMenu() {
    return (
            <header className="menu">
                <nav className="navMenu">
                    <ul>
                        <li> <Link to = "/harley" style={{color:"#008B00"}} className="harley"> HARLEY </Link> </li>
